import React from 'react';
import PropTypes from 'prop-types';

function DropZone({tag, rect}) {
    const content = props.children;
    const style = {
      left: rect.left,
      top: rect.top,
      width: rect.width,
      height: rect.height
    };
    
    return (
      <div className={tag} style={style}>
        {content}
      </div>
    );
}

DropZone.propTypes = {
  tag: PropTypes.string.isRequired
}

export default DropZone;
